import React from 'react';
import { useAuth } from '../contexts/AuthContext';
import FeedPage from './FeedPage';

const HomePage = () => {
  const { user } = useAuth();

  if (user) {
    return <FeedPage />;
  }

  return (
    <div>
      <h1>Bem-vindo ao iFunny Clone</h1>
      <p>Faça login para ver o conteúdo</p>
    </div>
  );
};

export default HomePage;
